$_MODULE['<{paytpv}prestashop>paytpv-account_0016fb206147ce40e0b0c047777279f9'] = 'Všechny informace o transakcích, které jsou předávány mezi touto webovou stránkou a systémy PAYTPV, jsou kódovány prostřednictvím certifikátů SSL 256 bits. Všechny informace o majiteli jsou předány zakódované a všechna ohlášení zaslaná na Váš server z PAYTPV jsou vázána prostřednictvím hashing SHA, aby nedošlo k jejich manipulacím. Informace, které jsou předávány na server z PAYTPV, nemohou být zkoumány, skenovány, používány nebo modifikovány žádným externím subjektem, který by obdržel přístup k důvěrným informacím.';
