$_MODULE['<{paytpv}prestashop>paytpv-account_34b967476a10ad43bc22b673edba98b4'] = 'Po uložení v systémech PAYTPV jsou důvěrné informace chráněny standardy šifrování 1024 bits. Klíče k šifrování jsou drženy ve vysoce zabezpečných nestálých systémech s dvojitou autorizací, což znemožňuje jejich odběr. Banky, bezpečnostní činitelé a bankovní subjekty provádějí pravidelně audit kvůli zajištění ochrany dat.';
