$_MODULE['<{paytpv}prestashop>paytpv-account_e822dc0e7b711d02f6ed6c0b34d92ff2'] = 'Systémy PAYTPV jsou čtvrtletně zkoumány prostřednictvím specifických nástrojů ISO, Kvalifikovaného Bezpečnostního nezávislého Poradce (QSA) a poskytovatele výzkumu (ASV) ověřeného značkami platebních karet.';
$_MODULE['<{paytpv}prestashop>paytpv-account_d009bf54f459a2a9c1e516ae765ab0fd'] = 'PAYTPV se také podřizuje každoročním auditům podle bezpečnostních standardů pro data o platebních kartách (PCI DSS) a je dodavatelem služeb platby schválené Úrovně 1, což je nejvíce výkonná úroveň.';
