$_MODULE['<{paytpv}prestashop>paytpv-account_0ae902925f2cf9350aac524f5eb4cf95'] = 'Vnitřní bezpečnost';
$_MODULE['<{paytpv}prestashop>paytpv-account_2bf0c149d1690aa41a2179a597588b69'] = 'V PAYTPV je prováděn audit v kontrolách přístupu a v prostředí produkce. CPD, kde jsou umístěny systémy, působí v souladu s požadavky na centra Tier III. Touto formou je zajištěno, že není v žádné chvíli ohrožena bezpečnost. K dispozici jsou sofistikované alarmové systémy, dohled prostřednictvím uzavřených TV okruhů. Dohled nad bezpečností, který je přítomný 24 hodin denně 7 dní v týdnu v zařízeních, stejně tak jako monitorování a přísná údržba.  Všechny informace o transakcích a platebních kartách jsou navíc chráněny také našimi vlastními zaměstnanci.';
